pragma solidity >=0.4.0 <0.6.0;
contract func{
    string word;
    uint number;
    address owner;
    constructor()public
    {
        word="bird";
        number=42;
        owner=msg.sender;
    }
    event changed(address a);
    modifier onlyowner()
    {
        if(msg.sender!=owner)
        {
            revert();
        }
        _;
    }
    function getword() public view returns (string memory)
    {
        return word;
    }
    function setword(string memory w) public onlyowner{
        word=w;
        emit changed(msg.sender);
    } 
}
